import React, { useState } from 'react';
import styled from 'styled-components';

const BoardWriteFormWrapper = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-flow: row wrap;
`;

interface Props {}

const BoardWriteForm = ({}: Props): JSX.Element => {
  return <BoardWriteFormWrapper></BoardWriteFormWrapper>;
};

export default BoardWriteForm;
